VALUES ('00491044', 'Wholemeal pittas', 'pain pita complet INGRÉDIENTS Farine complète de blé (contient Gluten) • Eau • Levure @(Levure • Levure enrichie en vitamine D) • Farine de blé fermenté déshydraté (contient Gluten) • Sel. Pour les allergènes, voir les ingrédients indiqués en gras. IMPORTANT Pour éviter tout risque d\'étouffement, garder l\'emballage hors de portée des nourrissons et jeunes enfants. CUISSON MICRO-ONDES Couper le haut du sachet, placer la totalité du paquet au micro-ondes : et cuire à pleine puissance. 850 W 40 sec. Une fois réchauffé, consommer le produit dans les 10-15 min, pour l\'apprécier au mieux. GRIL Asperger les pains d\'eau. Placer le produit directement sous un gril préchauffé. Retourner une fois. 1-2 min. Ne pas réchauffer après utilisation. CONSERVATION A consommer de préférence avant le : voir sur le devant de l\'emballage. A conserver de préférence dans un endroit frais et sec, à l\'abri de la lumière. Une fois ouvert, consommer dans les 2 jours. Peut être congelé. A congeler au plus tard à la date indiquée et à utiliser dans les 3 mois suivant la congélation. Ne pas recongeler un produit décongele. Décongeler complètement avant utilisation. Conditionné sous atmosphere protectrice.', '', '1.5', '0.2', '49.4', '1', '3', '8.7', '0.58', '0.228346456692913', '', '1');

